var search_terms = []
var search_results = []
var search_results_links = []

function load() {
	var search_results = []
	var search_results_links = []
	for (var key in dict){
		var curr_list = dict[key]
		for (i = 1; i < curr_list.length; i++){
			var object = curr_list[i]
			var doc_name = object[0]
			var link = object[1]
			if (search_results.indexOf(doc_name) == -1){
				search_results.push(doc_name)
				search_results_links.push(link)
			}
		}
	}
	var contentstring = ""
	for (i = 0; i < search_results.length; i++){
		contentstring += '<li><a target="_blank" href='+search_results_links[i]+'>'+search_results[i]+'</a></li>'
	}
	document.getElementById("content").innerHTML = contentstring;
}

function selective_load() {
	var search_results = []
	var search_results_links = []
	for (var key in dict){
		if (search_terms.indexOf(key) == -1){
			continue;
		}
		var curr_list = dict[key]
		for (i = 1; i < curr_list.length; i++){
			var object = curr_list[i]
			var doc_name = object[0]
			var link = object[1]
			if (search_results.indexOf(doc_name) == -1){
				search_results.push(doc_name)
				search_results_links.push(link)
			}
		}
	}
	var contentstring = ""
	for (i = 0; i < search_results.length; i++){
		contentstring += '<li><a target="_blank" href='+search_results_links[i]+'>'+search_results[i]+'</a></li>'
	}
	document.getElementById("content").innerHTML = contentstring;
}

function submitted() {
	var val = document.getElementById("field").value
	if (val == "") {return}
	search_terms.push(val);
	console.log(search_terms);
	document.getElementById("field").value = "";
	fill_search_terms_list();
}

function fill_search_terms_list() {
	var HTML_String = "<li>Search Terms: </li>"
	for (i = 0; i < search_terms.length; i++){
		HTML_String += "<li> <button onClick=removeElement("+ String(i) +")> X " + search_terms[i] + " </button> </li>"
	}
	document.getElementById("menu").innerHTML = HTML_String
	if (search_terms.length == 0){
		load();
	}
	else {
		selective_load();
	}
}

function removeElement(index){
	search_terms.splice(parseInt(index),1)
	fill_search_terms_list();
}
